        .dataTable-wrapper.no-header .dataTable-container {
	border-top: 1px solid #d9d9d9;
}

.dataTable-wrapper.no-footer .dataTable-container {
	border-bottom: 1px solid #d9d9d9;
}

.dataTable-top,
.dataTable-bottom {
	padding: 8px 10px;
}

.dataTable-top > nav:first-child,
.dataTable-top > div:first-child,
.dataTable-bottom > nav:first-child,
.dataTable-bottom > div:first-child {
	float: left;
}

.dataTable-top > nav:last-child,
.dataTable-top > div:last-child,
.dataTable-bottom > nav:last-child,
.dataTable-bottom > div:last-child {
	float: right;
}

.dataTable-selector {
	padding: 6px;
}

.dataTable-input {
	padding: 6px 12px;
}

.dataTable-info {
	margin: 7px 0;
}

/* PAGER */
.dataTable-pagination ul {
	margin: 0;
	padding-left: 0;
}

.dataTable-pagination li {
	list-style: none;
	float: left;
}

.dataTable-pagination a {
	border: 1px solid transparent;
	float: left;
	margin-left: 2px;
	padding: 6px 12px;
	position: relative;
	text-decoration: none;
	color: #333;
}

.dataTable-pagination a:hover {
	background-color: #d9d9d9;
}

.dataTable-pagination .active a,
.dataTable-pagination .active a:focus,
.dataTable-pagination .active a:hover {
	background-color: #d9d9d9;
	cursor: default;
}

.dataTable-pagination .ellipsis a,
.dataTable-pagination .disabled a,
.dataTable-pagination .disabled a:focus,
.dataTable-pagination .disabled a:hover {
	cursor: not-allowed;
}

.dataTable-pagination .disabled a,
.dataTable-pagination .disabled a:focus,
.dataTable-pagination .disabled a:hover {
	cursor: not-allowed;
	opacity: 0.4;
}

.dataTable-pagination .pager a {
	font-weight: bold;
}

/* TABLE */
.dataTable-table {
	max-width: 100%;
	width: 100%;
	border-spacing: 0;
	border-collapse: separate;
}

.dataTable-table > tbody > tr > td,
.dataTable-table > tbody > tr > th,
.dataTable-table > tfoot > tr > td,
.dataTable-table > tfoot > tr > th,
.dataTable-table > thead > tr > td,
.dataTable-table > thead > tr > th {
	vertical-align: top;
	padding: 8px 10px;
}

.dataTable-table > thead > tr > th {
	vertical-align: bottom;
	text-align: left;
	border-bottom: 1px solid #d9d9d9;
}

.dataTable-table > tfoot > tr > th {
	vertical-align: bottom;
	text-align: left;
	border-top: 1px solid #d9d9d9;
}

.dataTable-table th {
	vertical-align: bottom;
	text-align: left;
}

.dataTable-table th a {
	text-decoration: none;
	color: inherit;
}

.dataTable-sorter {
	display: inline-block;
	height: 100%;
	position: relative;
	width: 100%;
}

.dataTable-sorter::before,
.dataTable-sorter::after {
	content: "";
	height: 0;
	width: 0;
	position: absolute;
	right: 4px;
	border-left: 4px solid transparent;
	border-right: 4px solid transparent;
	opacity: 0.2;
}

.dataTable-sorter::before {
	border-top: 4px solid #000;
	bottom: 0px;
}

.dataTable-sorter::after {
	border-bottom: 4px solid #000;
	border-top: 4px solid transparent;
	top: 0px;
}

.asc .dataTable-sorter::after,
.desc .dataTable-sorter::before {
	opacity: 0.6;
}

.dataTables-empty {
	text-align: center;
}

.dataTable-top::after, .dataTable-bottom::after {
	clear: both;
	content: " ";
	display: table;
}

  .top-bar {
    z-index: 999;
    position: fixed;
    left: 0%;
    right: 0%;
    top: 0%;
    height: 40px;
    padding: 10px;

    /* Dark/Background/Paper/Elevation 16 */
    background: linear-gradient(180deg, rgba(255, 255, 255, 0.15) 0%, rgba(255, 255, 255, 0.15) 100%), #10184c;

    display: flex;
    justify-content: space-between;
    align-items: center;
  }

  .top-bar .element {
    display: flex;
    align-items: center;
  }

  .top-bar .title {
    font-size: 1.5rem;
    padding-left: 1rem;
  }

  .top-bar svg {
    height: 50px;
    width: 50px;
  }

  .sbom-tools {
    gap: 15px;
  }

  .sbom-button {
    position: relative;
    border: 1px solid #4adede;
    border-radius: 6px;
    background-color: #10184c;
    z-index: 10;
    padding: 12px 15px 15px 15px;
    font-size: 14px;
    color: #fff;
  }

  .sbom-button:disabled {
    color: lightgray;
    border: gray;
  }

  .sbom-selector-wrapper {
    position: relative;
    display: block;
    max-width: 500px;
    min-width: 350px;
    border: 1px solid #4adede;
    border-radius: 6px;
    background-color: #10184c;
    z-index: 10;
  }

  .sbom-selector-wrapper select {
    border: none;
    outline: none;
    background: transparent;
    -webkit-appearance: none;
    -moz-appearance: none;
    appearance: none;
    border-radius: 0;
    margin: 0;
    display: block;
    width: 100%;
    padding: 12px 55px 15px 15px;
    font-size: 14px;
    color: #fff;
  }

  .sbom-selector-wrapper:after {
    position: absolute;
    right: 0;
    top: 0;
    width: 35px;
    height: 100%;
    line-height: 45px;
    content: "▼";
    text-align: center;
    color: #4adede;
    font-size: 12px;
    z-index: -1;
  }

  .sbom-file::file-selector-button {
    position: relative;
    border: 1px solid #4adede;
    border-radius: 6px;
    background-color: #10184c;
    z-index: 10;
    padding: 12px 15px 15px 15px;
    font-size: 14px;
    color: #fff;
    margin-right: 15px;
  }

  .sbom-spacer {
    flex-grow: 1
  }

  #actions {
    display: flex;
    align-items: center;
    gap: 15px;
  }

  #modal-fader {
    display: none;
    position: fixed;
    top: 0;
    left: 0;
    right: 0;
    bottom: 0;
    width: 100%;
    z-index: 99998;
    background: rgba(0, 0, 0, 0.8);
  }

  #modal-fader.active {
    display: block;
  }

  #modal {
    display: none;
    position: absolute;
    left: 50%;
    transform: translateX(-50%);
    z-index: 99999;
    color: #10184c;
    background: rgba(255, 255, 255, 0.95);
    padding: 20px;
    border-radius: 5px;
    font-family: sans-serif;
    top: 50px;
  }

  #modal.active {
    display: block;
  }

  #modal h1,
  #modal h2,
  #modal h3,
  #modal h4,
  #modal h5,
  #modal h6 {
    margin: 0;
  }

  .modal-btn {
    background: #10184c;
    border: none;
    color: #fff;
    padding: 10px 15px;

    border-radius: 3px;

  #actions {

  .file-selector {

  .added {
    background-color: #22541a;
  }

  .removed {

        <h2 id="modal-title"></h2>
        <p id="modal-content"></p>
        <button class="modal-btn modal-hide" onclick="hideModal()">Close</button>
    </div>
    <div id="modal-fader"></div>

    <div id="actions">
        <h2 id="distro-info"></h2>
        <div class="sbom-spacer"></div>
        <button id="sbom-export" onclick="exportCSV(sbomSelector.selectedOptions[0].value)" class="sbom-button">
            Export CSV
        </button>
    </div>
</body>

<script type="text/javascript">
    const sbomSelector = document.getElementById('sbom-selector');
const distroInfo = document.getElementById('distro-info');
const modal = document.getElementById('modal');
const modalFader = document.getElementById('modal-fader');
const modalTitle = document.getElementById('modal-title');
const modalContent = document.getElementById('modal-content');
const artifactsTable = document.createElement('table');
const mailtoMaintainerReplace = `&nbsp;|&nbsp;&nbsp;<a href="mailto:$1">$1</a>`;

document.body.appendChild(artifactsTable);

function fileList(files, artifactName) {
	if (files) {
		const list = (files || []).map((file) => file.path || '').filter((test) => test);

		if (list.length > 0) {
			flatList = list.sort().join('<br>');
			return `<a href="#" onClick="showModal('${
				artifactName
			}','${flatList}')">${list.length} files</a>`;
		}
	}

	return '-';
}

function choose(path) {
	if (path !== '-') {
		window.location.href = encodeURIComponent(`sbom-viewer-${path}.html`);
	}
}

function exportCSV(path) {
	if (window.dt) {
		window.dt.export({
			type: 'csv',
			filename: path
		});
	} else {
		showModal('Unable to Export', 'No data in current table');
	}
}

function showModal(title, list) {
	modalTitle.innerText = `Files for ${title}`;
	modalContent.innerHTML = list;
	modalFader.className = 'active';
	modal.className = 'active';
}

function hideModal() {
	modalFader.className = '';
	modal.className = '';
	modalTitle.innerText = '';
	modalContent.innerHTML = '';
}

    function initSelector() {
	const url = /sbom-viewer-(.*).html*$/gim.exec(window.location.href)[1];

	ZARF_SBOM_LIST.sort().forEach((item) => {
		let selected = url === item ? 'selected' : '';
		sbomSelector.add(new Option(item, item, selected, selected));
	});
}

function initData() {
	const payload = ZARF_SBOM_DATA;

	const transformedData = payload.artifacts.map((artifact) => {
		return [
			artifact.type,
			artifact.name,
			artifact.version,
			fileList(artifact.locations, artifact.name),
			(artifact.metadata && fileList(artifact.metadata.files, artifact.name)) || '-',
			(artifact.metadata && artifact.metadata.description) || '-',
			((artifact.metadata && artifact.metadata.maintainer) || '-').replace(
				/\u003c(.*)\u003e/,
				mailtoMaintainerReplace
			),
			(artifact.metadata && artifact.metadata.installedSize) || '-'
		];
	});

	const data = {
		headings: ['Type', 'Name', 'Version', 'Sources', 'Package Files', 'Notes', 'Maintainer', 'Size'],
		data: transformedData
	};

	if (window.dt) {
		window.dt.destroy();
	}

	distroInfo.innerHTML = payload.distro.prettyName || 'No Base Image Detected';

	window.dt = new simpleDatatables.DataTable(artifactsTable, {
		data,
		perPage: 20
	});
}

function compare() {
	window.location.href = 'compare.html';
}

initSelector();
initData();

</script>
